import React, { Component } from "react";

class Table extends Component {
  render() {
    return (
      <tbody className="table">
        <tr>
            <th scope="col">1</th>
            <th scope="col">Phuc</th>
            <th scope="col">234</th>
          </tr>
      </tbody>
    );
  }
}

export default Table;
